    "Collecting this data helps us improve Minecraft by guiding us in directions that are relevant to our players.",
    "You can also send in additional feedback to help us keep improving Minecraft.=Збір цих даних допомагає нам покращувати Minecraft у тих напрямках, які актуальні для наших гравців.",
