    "Telemetry Data Collection=Збір телеметричних даних",
    "Understanding the context behind receiving an advancement can help us better understand and improve the progression of the game.=Розуміння контексту отримання досягнення може допомогти нам краще розуміти та покращувати прогрес у грі.",
