    "Performance Metrics=Показники продуктивности",
    "%s (Required)=%s (необхідно)",
    "It’s important for us to understand how long it takes to join a world, and how that changes over time. For example, when we add new features or do larger technical changes, we need to see what impact that had on load times.=Нам важливо зрозуміти, скільки часу потрібно, щоб приєднатися до світу, і як це змінюється з часом. Наприклад, коли ми додаємо нові можливості чи робимо більші технічні зміни, нам потрібно побачити, який уплив це має на завантаження світу.",
    "World Load Times=Час завантаження світу",
    "Knowing how players play Minecraft (such as Game Mode, client or server modded, and game version) allows us to focus game updates to improve the areas that players care about most.",
