"The mighty door. Way better than using dirt to seal up a wall. Interact with your door when placed and it'll open and close, stopping mobs from getting in and letting you get out!=Могутні двері. Це куди краще, ніж замазувати стіну землею. Взаємодійте з дверима після розміщення, і вони відкриватимуться й закриватимуться, не пускаючи всередину мобів, але дозволяючи вам вийти!",
"Resource packs are applied bottom to top. This means any asset that is in two packs will be overridden by the higher pack. These packs in your world apply on top of your global pack(s).=Пакети ресурсів застосовуються знизу догори. Це означає, що вміст верхнього пакета перезаписуватиме вміст нижнього. Ці пакети у вашому світі застосовуються поверх ваших глобальних пакетів.",
"Hey there explorer, welcome to the winter wonderland! Let's adventure through the snowy world together, where we might find some awesome rewards! Choose your path and let's see what we can find.=Вітаю дослідників у зимовій країні! Вирушаймо разом на пошуки пригод у засніженому світі, де ми знайдемо фантастичні винагороди! Оберіть свій шлях, і подивимося, що ви знайдете.",
"Thanks for playing Minecraft Earth! We have made the difficult discussion to end support for Minecraft Earth on June 30th 2021. Thanks for playing and we hope to see you in Minecraft!=Дякуємо, що граєте в Minecraft Earth! Ми прийняли важке рішення про припинення підтримки Minecraft Earth із 30 червня 2021 року. Дякуємо, що грали, і сподіваємося побачити вас у Minecraft!",
"Glass might be easy to make, but it's one of the world's loveliest materials. By simply building a wall of glass you can bring the beauty of the natural world into the comfort of your own home.=Виготовляти скло нескладно, але це один із найпрекрасніших матеріалів у світі. Просто збудувавши стіну зі скла, ви зможете насолоджуватися красою природи в затишку власного дому.",
"So fresh, so clean! Experience Minecraft in a whole new light! Collect tappables for resources, craft weapons and explore adventure crystals to find amazing and unique treasures!=Усе таке нове, таке свіже! Погляньте на Minecraft із геть нового боку! Збирайте ресурси з предметів, створюйте зброю та досліджуйте кристали пригоди, щоб знайти неймовірні та унікальні скарби!",
"Hey there adventurer, welcome to the grassy plains!  I'm going on a treasure hunt, do you want to come with me? Let's explore these paths and see what amazing things we can find!=Привiт шукачу пригод, ласкаво прошу до трав’янистих рівнин! Я вирушаю на полювання за скарбами, хочеш приєднатися? Давай дослідим ці стежки та дізнаємося, які дивовижні речі ми зможемо знайти!",
"Enables beta features. Experimental gameplay may break your world. If you continue we will make a copy of your world starting with [EX] with this feature turned on.=Таким чином активуються функції в бета-версії. Експериментальний режим може зламати світ. Якщо ви вирішите продовжити, ми зробимо копію світу з префіксом [EX] в імені, для якого буде ввімкнуто цю функцію.",
"This world has Behavior Packs applied to it that you must download to join and Resource Packs that you may optionally download before joining. What would you like to download before joining?=Щоб приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети поведінки, а також пакети ресурсів за бажанням. Що ви хочете завантажити перед приєднанням?",
"The following content is dependent on this %s and may not continue to work correctly if you delete \"%s\":%s Do you still want to delete \"%s\"? This %s will be lost forever! (A long time!)=Цей вміст залежить від %s і не зможе працювати належним чином, якщо видалити \"%s\":%s Ви справді хочете видалити \"%s\"? Вміст %s буде втрачено назавжди! (Це дууууже довго!)",
"This world was created using a template that you have not unlocked. You must purchase the template to unlock this world.  Would you like to purchase the template used by this world?=Цей світ створено на основі шаблону, який у вас не розблоковано. Щоб розблокувати цей світ, вам потрібно придбати шаблон. Хочете придбати шаблон, що використовується в цьому світі?",
