"Summons an uncommon Adventure; be cautious, there might be monsters or challenging puzzles. Make sure to have good space to play, big room or backyard.=Створює незвичайну пригоду. Будьте обережні, адже на вас можуть чекати монстри або складні головоломки. Грайте там, де багато місця (у великій кімнаті чи на задньому дворі, якщо живете у приватному будинку).",
"Your device is almost out of the space that Minecraft can use to save worlds and settings on this device.  Why not delete some old stuff you don't need so that you can keep saving new stuff?=На вашому пристрої майже закінчилося місце, яке Minecraft може використовувати для збереження світів і настройок! Видаліть старі непотрібні файли, щоб зберігати нові.",
"It looks like you are signed into a different Microsoft Account from the one that first downloaded the Minecraft Trial. Try again after signing in with that account.=Схоже, ви ввійшли не під тим обліковим записом Microsoft, з якого було вперше завантажено ознайомлювальну версію Minecraft. Спробуйте ще раз, після того як увійдете під цим обліковим записом.",
"Hey there fearless explorer, welcome to Boo! Spooky! Let's explore this area together, we might find some awesome treasure! Choose your path and let's see what we can find.=Ей, безстрашні дослідники, зустрічайте \"Кріпота!\" Будемо досліджувати цю територію разом, можливо, вдасться знайти неймовірні скарби! Оберіть свій шлях, і подивимося, що ви знайдете.",
"You cannot play online multiplayer through Xbox Live because of how your account is set up. This can be changed in your privacy & online safety settings on Xbox.com.=Ви не можете грати онлайн із кількома гравцями на Xbox Live через налаштування вашого облікового запису. Ви можете змінити параметри конфіденційності й безпеки в Інтернеті на сайті Xbox.com.",
"Summons a large, challenging Adventure. Bring  good tools, food and all your senses. Invite friends to play it with you, otherwise there's a good chance you won't make it out alive.=Створює велику, складну пригоду. Візьміть якісні інструменти, їжу та свої навички. Запросіть друзів до гри разом, тому що з дуже високою вірогідністю наодинці ви не виживете.",
"We did it! We found the treasure. That was fun! If you've seen other treasures in the area, feel free to keep searching. Thanks again, and I hope to see you for another adventure soon.=У нас вийшло! Ми знайшли скарб. Було весело! Якщо десь ще виднілися скарби, можна продовжити пошуки. Дякую ще раз, сподіваюся незабаром зустріти тебе в наступній пригоді.",
"We did it! We found the treasure. That was fun! If you've seen other treasures in the area, feel free to keep searching. Thanks again, and I hope to see you for another adventure soon.=У нас вийшло! Ми знайшли скарб. Було весело! Якщо десь ще виднілися скарби, можна продовжити пошуки. Дякую ще раз, сподіваюся незабаром зустріти тебе в наступній пригоді.",
