"As a thank you for being a part of the amazing community, we are awarding all players with a set of 4 very exclusive character customizations, which you can bring into Bedrock.=На знак подяки за те, що ви є частиною дивовижної спільноти, ми нагороджуємо всіх гравців набором із 4 найексклюзивніших налаштувань персонажів, які ви можете взяти в Bedrock.",
"Hey there adventurer, welcome to the grassy plains! I'm going on a treasure hunt, do you want to come with me? Let's explore these paths and see what amazing things we can find!=Вітаю мандрівників на трав’янистих рівнинах! Я вирушаю на полювання за скарбами, хочеш приєднатися? Підемо цими доріжками та дізнаємося, які дивовижні речі тут можна знайти!",
"You cannot chat with other players because of how your Xbox Live account is set up.  This can be changed in your privacy & online safety settings on Xbox.com.=Ви не можете спілкуватися з іншими гравцями в чаті через налаштування вашого облікового запису Xbox Live. Ви можете змінити параметри конфіденційності й безпеки в Інтернеті на сайті Xbox.com.",
"Servers offer some of the most creative ways to play Minecraft! We just need you to sign in so that we can make sure you have permission to play online with new people.=Граючи в Minecraft на серверах, можна дати повну свободу своїй уяві! Вам лише потрібно ввійти в обліковий запис, щоб ми могли перевірити ваш дозвіл на гру в мережі з новими людьми.",
"A  natural  partner  to  the  hopper,  this block  can  take  items  out  of  blocks  with  inventories  and  drop  them  when  powered  with  a  switch  or  redstone circuit.=Природний партнер воронки, цей блок може отримувати предмети з блоків з інвентарем і надавати їх, якщо подати на нього живлення за допомогою перемикача або кола редстоуну.",
"Sign in to Xbox Live to sync your Minecoins, Skins, Texture Packs, Worlds, and Mash-ups. They will be there for you on any device where you play Minecraft. =Увійдіть в Xbox Live, щоб синхронізувати свої Minecoins, скіни, пакети текстур, світи та збірні пакети. Вони будуть доступні для вас на будь-якому пристрої, з якого ви граєте в Minecraft.",
"Hey there adventurer, welcome to the snowy tundra! Let's explore this area together, we might find some awesome treasure! Choose your path and let's see what we can find.=Вітаю шукача пригод у засніженій тундрі! Будемо досліджувати цю територію разом, можливо, вдасться знайти неймовірні скарби! Оберіть свій шлях, і подивимося, що ви знайдете.",
