"Certain commands like teleport are only available with cheats ON.  Cheats can also be turned on through the pause menu under Game Settings.=Деякі команди, як-от телепорт, доступні лише за ввімкнутих чітів. Чіти також можна ввімкнути в меню паузи під параметрами гри.",
"Thanks for testing Realms! The features are not final and you might run into bugs.  Send us feedback! We're listening.=Дякуємо за тестування реалмів! Їхня функціональність ще не дороблена, і ви можете натрапити на баги. Надсилайте нам відгуки! Нам цікава ваша думка.",
