"For Boost Minis to work, you need to enable NFC functionality in your device. Enable NFC from your device settings to play.=Щоб використовувати мініпідсилювачі, вам потрібна підтримка NFC на вашому пристрої. Увімкніть NFC в параметрах свого пристрою, щоб грати.",
"Amazing! Look at all the beautiful things you've found. Let's keep looking, I bet there are even more incredible treasures to find.=Дивовижно! Погляньте на прекрасні речі, які ви знайшли. Варто продовжити шукати, тут точно сховано ще більше неймовірних скарбів.",
"Bored of single, solid colors? The Rainbow Sheep grows wool with not one, not two, but SIX bold hues to make rainbow-tastic creations.=Набридло все однотонне? На веселковій вівці росте вовна не одного, не двох, а ШЕСТИ яскравих відтінків для райдужних витворів.",
"Cobblestone stair blocks are handy for forming stepped roofs and for creating the appearance of a curved surface or edge. Stairs are wonderful!=З блоків сходів із кругляка зручно формувати ступінчасті дахи та створювати хвилясті поверхні або краї. Сходи чудові!",
"Find some Adventure Crystals to start your very own, private Adventure! Find them in Tappables or other Adventures on the map.=Знайдіть кристали пригоди, щоб розпочати свою власну особисту пригоду! Їх можна знайти серед предметів або в інших пригодах на карті.",
"Ooooh shiny! Glowstone glows slightly brighter than torches, so you can make a wall of glowstone blocks to illuminate a room.=Як яскраво! Світлокамінь сяє трохи яскравіше за смолоскипи, тому ви можете зробити стіну з блоків світлокаменю для освітлення кімнати.",
"Sandstone stair blocks are handy for forming stepped roofs and for creating the appearance of a curved surface or edge. Stairs are wonderful!=З блоків сходів із піщаника зручно формувати ступінчасті дахи та створювати хвилясті поверхні або краї. Сходи чудові!",
"Visitors can freely explore your world, but cannot interact with blocks, items, or entities. Trust Players Off.=Відвідувачі можуть вільно досліджувати ваш світ, але не можуть взаємодіяти з блоками, предметами та сутностями. Функція надійних гравців вимкнута.",
"Have a music disc? You'll need a jukebox to play it. Add that little extra ambience to any buildplate you make.=Маєте музичний диск? Вам потрібен музичний автомат для його відтворення. Додайте трохи атмосфери до будь-якої будівельної плити, яку ви створюєте.",
"Content purchased through a partner store will be available as long as your device is signed in to your partner store account.=Вміст, придбаний через партнерський магазин, буде доступний, якщо на пристрої ввійти під обліковим записом партнерського магазину.",
"Have an idea to improve Minecraft? Find a bug that you want fixed? Or encounter an issue you need help with?  Let us know!=Маєте ідею, як удосконалити Minecraft? Знайшли помилку, які потрібно виправити? Потрібна допомога з вирішенням проблеми? Напишіть нам!",
"This world has Behavior Packs applied to it that you must download to join. Would you like to download them and join?=Щоб приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети поведінки. Хочете завантажити їх і приєднатися до світу?",
"Thank you for playing Minecraft Earth! Here is a gift of a set of exclusive customization items as a huge thank you from the team.=Дякуємо за гру в Minecraft Earth! Даруємо вам набір ексклюзивних предметів налаштування на знак величезною подяки від команди.",
"Andesite stair blocks are handy for forming stepped roofs and for creating the appearance of a curved surface or edge. Stairs are wonderful!=З блоків сходів з андезиту зручно формувати ступінчасті дахи та створювати хвилясті поверхні або краї. Сходи чудові!",
"This world has Resource Packs applied to it that you must download to join. Would you like to download them and join?=Щоб приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети ресурсів. Хочете завантажити їх і приєднатися до світу?",
"Behavior Packs are applied bottom to top. That means anything that is in two Behavior Packs will be overridden by the higher one.=Пакети поведінки застосовуються знизу догори. Це означає, що вміст верхнього пакета поведінки перезаписуватиме вміст нижнього.",
"So flamboyant! Beds are one of the first things you'll want to make for your new house because they are brilliant. Who doesn't like a bed?=Яка вигадливість! Для нового будинку ви в першу чергу захочете зробити ліжко, бо воно незамінне. Хто не любить ліжок?",
"So monochrome! Beds are one of the first things you'll want to make for your new house because they are brilliant. Who doesn't like a bed?=Яка однотонність! Для нового будинку ви в першу чергу захочете зробити ліжко, бо воно незамінне. Хто не любить ліжок?",
"Diorite stair blocks are handy for forming stepped roofs and for creating the appearance of a curved surface or edge. Stairs are wonderful!=З блоків сходів із діориту зручно формувати ступінчасті дахи та створювати хвилясті поверхні або краї. Сходи чудові!",
"Granite stair blocks are handy for forming stepped roofs and for creating the appearance of a curved surface or edge. Stairs are wonderful!=З блоків сходів із граніту зручно формувати ступінчасті дахи та створювати хвилясті поверхні або краї. Сходи чудові!",
"Not quite a snow block, Top Snow is great for that little bit of festive decoration you might be looking for.=Хоча це й не зовсім сніговий блок, верхній шар снігу чудово підходить, щоб трохи прикрасити все до новорічних свят. Можливо, саме це вам потрібно.",
"You are almost out of data storage space! Minecraft has restricted access to this feature until you clear up additional storage space.=Ви майже вичерпали простір для зберігання даних. Minecraft заборонив доступ до цієї функції, доки ви не звільните місце.",
