"The fuel you're using and its intensity is here. Tap to see other fuel options.=Паливо, яке ви використовуєте, і його споживання вказано тут. Торкніться, щоб переглянути інші варіанти палива.",
"These meek creatures love colors, and are also more than happy to be your endless supply of wool.=Ці смиренні істоти люблять усе різнокольорове та невимовно раді постійно постачати вам вовну.",
