"Using the most versatile of all materials, defend yourself from the wild monsters you might encounter.=Захистіть себе від диких монстрів, використовуючи найуніверсальніший з усіх матеріалів!",
"This game needs the latest version of ARCore to run. Tap on the button below to install it!=Для роботи цієї гри потрібна найновіша версія ARCore. Натисніть кнопку нижче, щоб інсталювати її!",
"This is the perfect block for planting and growing seeds, root vegetables and some saplings.=Цей блок ідеально підходить для саджання й вирощування насіння, коренеплодів і деяких саджанців.",
