"Sturdy and monochrome, this concrete block will liven up any of your buildplate creations.=Цей блок із бетону міцний та однотонний і оживить ваші архітектурні шедеври на будівельній плиті.",
"Protect your legs in style with armor made from the most versatile all materials.=Захистіть свої ноги зі стилем за допомогою обладунків, зроблених із найуніверсальнішого з усіх матеріалів.",
"Signs can be used to leave notes and instructions, label chests, or tell stories.=За допомогою знаків можна залишати примітки й інструкції, вішати ярлики на скрині або розповідати історії.",
"The pigs are a breed of simple souls, with a fondness for root vegetables and surprisingly strong backs. =Свині – це простяцька порода, що полюбляє коренеплоди та має напрочуд міцну спину.",
