"Don't let this rabbit’s dapper appearance fool you. It'll still gobble up your carrots!=Але не дайте франтуватому вигляду цього кролика вас обдурити. Він усе одно погризе всю вашу моркву!",
"This resolution is incompatible with your device because your device doesn't have enough memory.=Ця роздільна здатність несумісна з вашим пристроєм, тому що на ньому недостатньо пам’яті.",
